import React from 'react';
import './Header.css';
import Mypic from '../Untitled design (1).png';
import Giffy from '../yy3.gif';

const Header = () =>{
    return(
        <div>
            <img src={Giffy}></img>
            <img src={Mypic} className="Mypic"></img>
            <div className="secdiv">
                <h1>About Be</h1>
                <h1>Areas Of Expertise</h1>
            </div>

        </div>
    )
}

export default Header;
